import React from 'react'
import {
  Switch,
  Route,
} from "react-router-dom";
import './App.css';
import Navbar from './components/navbar/Navbar';
import Banner from './components/Banner/Banner';
import RowPost from './components/RowPost/RowPost';
import { Top_Rated,Upcoming,Now_Playing,Popular, TV_Shows } from './urls/url';


function App() {
  return (
    <div className="App">
      <Navbar />
      <Banner />
    <Route> <RowPost url={Top_Rated} title={'Netflix Originals'} /></Route> 
    <Route> <RowPost url={Now_Playing} title={'Action'} isSmall/></Route> 
    <Route> <RowPost url={Upcoming} title={'Upcoming'} isSmall/></Route> 
    <Route> <RowPost url={Popular} title={'Popular'} isSmall/></Route> 
    <Route>  <RowPost url={TV_Shows} title={'TV Shows'} isSmall/></Route> 
    </div>
  );
}

export default App;
